import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import '../styles/style.css';

function Menu() {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" sticky="top" className="navbar-custom">
      <Container>
        <Navbar.Brand href="/">My Website</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/fitness" className="fitness-dropdown">
              Fitness
              <div className="fitness-dropdown-content">
                <Nav.Link as={Link} to="/fitness/training">Training</Nav.Link>
                <Nav.Link as={Link} to="/fitness/diet">Diet</Nav.Link>
                <Nav.Link as={Link} to="/fitness/consultation">Consultation</Nav.Link>
              </div>
            </Nav.Link>
            <Nav.Link as={Link} to="/contact">Contact</Nav.Link>
            <Nav.Link as={Link} to="/login">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default Menu;
